{ علم أن سيكون منكم مرضى وآخرون يضربون في الأرض يبتغون من فضل الله وآخرون يقاتلون في سبيل الله فاقرءوا ما تيسر منه }

تأمل ثقل الأعذار : 
[ مرض - طلب رزق - جهاد ]

ومع هذا كله قال :
{ فاقرؤا ماتيسر منه }
فمهما كانت الأشغال ، والصوارف ، لابد أن نجعل وردا لتلاوة ما تيسر من القرآن .

{كل من عليها فان}
كل باكٍ سيُبكى ، وكل ناعٍ سيُنعى ، وكل مذخور سيفنى ، وكل مذكور سيُنسى ، ليس غير الله يبقى ، من علا فالله أعلى .  

#الموت
